// src/components/Dashboard.jsx
import React, { useEffect, useState } from 'react';
import './Dashboard.css';
const Dashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    totalSales: 150000,
    refundRate: 5,
    topSKUs: 50,
    topCreators: 30,
    campaignROI: 25,
    daily: 5000,
    weekly: 35000,
    monthly: 150000,
  });

  useEffect(() => {
    // Simulate fetching data
    const mockData = {
      totalSales: 150000,
      refundRate: 5,
      topSKUs: 50,
      topCreators: 30,
      campaignROI: 25,
      daily: 5000,
      weekly: 35000,
      monthly: 150000,
    };

    setTimeout(() => {
      setDashboardData(mockData); // Update state with the mock data
    }, 1000); // Simulate 1-second delay
  }, []);

  return (
    <div>
      <h2>Dashboard Overview</h2>

      {/* Displaying Cards for Daily, Weekly, and Monthly */}
      <div className="cards-container">
        {/* Daily Card */}
        <div className="card">
          <h3>Daily</h3>
          <div className="card-data">
            <p><strong>Total Sales:</strong> ${dashboardData.daily}</p>
            <div className="data-border"></div>
            <p><strong>Refund Rate:</strong> {dashboardData.refundRate}%</p>
            <div className="data-border"></div>
            <p><strong>Top SKUs:</strong> {dashboardData.topSKUs}</p>
            <div className="data-border"></div>
            <p><strong>Top Creators:</strong> {dashboardData.topCreators}</p>
            <div className="data-border"></div>
            <p><strong>Campaign ROI:</strong> {dashboardData.campaignROI}%</p>
          </div>
        </div>

        {/* Weekly Card */}
        <div className="card">
          <h3>Weekly</h3>
          <div className="card-data">
            <p><strong>Total Sales:</strong> ${dashboardData.weekly}</p>
            <div className="data-border"></div>
            <p><strong>Refund Rate:</strong> {dashboardData.refundRate}%</p>
            <div className="data-border"></div>
            <p><strong>Top SKUs:</strong> {dashboardData.topSKUs}</p>
            <div className="data-border"></div>
            <p><strong>Top Creators:</strong> {dashboardData.topCreators}</p>
            <div className="data-border"></div>
            <p><strong>Campaign ROI:</strong> {dashboardData.campaignROI}%</p>
          </div>
        </div>

        {/* Monthly Card */}
        <div className="card">
          <h3>Monthly</h3>
          <div className="card-data">
            <p><strong>Total Sales:</strong> ${dashboardData.monthly}</p>
            <div className="data-border"></div>
            <p><strong>Refund Rate:</strong> {dashboardData.refundRate}%</p>
            <div className="data-border"></div>
            <p><strong>Top SKUs:</strong> {dashboardData.topSKUs}</p>
            <div className="data-border"></div>
            <p><strong>Top Creators:</strong> {dashboardData.topCreators}</p>
            <div className="data-border"></div>
            <p><strong>Campaign ROI:</strong> {dashboardData.campaignROI}%</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
